import React from 'react';
import './NavBar.css';



export default class NavBar extends React.Component {
  // select sort mode : Select('mode')
  render() {
    const {whenClickReset, 
            whenScrolled, 
            arrayMax,
           mergeSortClick,
           quickSortClick,
           heapSortClick,
           selectionSortClick,
           } = this.props;

    return (<div className="navbar-container"
            style={{
            width: `${window.innerWidth}px`,
            height: `50px`
            }}>
              <button class="new-array-button" onClick={whenClickReset}>New Array</button>
              <input
              id="changeSize"
              type="range"
              min="10"
              max={arrayMax}
              onChange={whenScrolled}
              />
              <button class="new-array-button" onClick={mergeSortClick}>Merge Sort</button>
              <button class="new-array-button" onClick={quickSortClick}>Quick Sort</button>
              <button class="new-array-button" onClick={heapSortClick}>Heap Sort</button>
              <button class="new-array-button" onClick={selectionSortClick}>Selection Sort</button>



            </div>)
  };


};
